import React from 'react'
import './floting.css'


const FlotingDiv = ({image,txt1,txt2}) => {
  return (
    <div className="flotingdiv">
        <img src={image} alt="" />
        <span>
            {txt1}
            <br />
            {txt2}
        </span>
    </div>
  )
}

export default FlotingDiv
